	local Exp = GetExp(sceneId,selfId)
	local Xinfa_Exp = Xinfa[Xinfa_Level][XinfaID_Table]
	
	local Money = GetMoney(sceneId,selfId)
	local Xinfa_Money = Xinfa[Xinfa_Level][XinfaID_Table - 1]

	if Xinfa_Level == 121 then
		x380003_NotifyFailTips(sceneId, selfId, "Tm php  ln n thng hn!")
		return		
	end
	
	if Xinfa_Level - LevelSefl > 5 then
		x380003_NotifyFailTips(sceneId, selfId, "Hy nng cao thm cp   tip tc gia tng tm php")
		return		
	end
	
	if Exp < Xinfa_Exp then
		x380003_NotifyFailTips(sceneId, selfId, "Kinh nghim vn cha   thng cp tm php.")
		return
	end
	
	if GetMoney(sceneId,selfId) >= Xinfa_Money then
		CostMoney(sceneId, selfId, Xinfa_Money)
	else
		x380003_NotifyFailTips( sceneId, selfId, "Ngn lng khng   thng cp tm php." )
		return
	end
	
	LuaFnAddExp(sceneId,selfId,-Xinfa_Exp)
	LuaFnSetXinFaLevel(sceneId,selfId,XinfaID,Xinfa_Level)
	x380003_NotifyFailTips(sceneId, selfId, "Thng cp tm php thnh cng.")
	LuaFnSendSpecificImpactToUnit(sceneId,selfId,selfId,selfId,148,0)
end

function x380003_NotifyFailTips(sceneId, selfId, Tip)
	BeginEvent(sceneId)
		AddText(sceneId,Tip)
	EndEvent(sceneId)
	DispatchMissionTips(sceneId,selfId)
end